// const HOST = 'https://nutritioncare-api.herokuapp.com/';
const hostname = window && window.location && window.location.hostname;

const token = "Bearer " + localStorage.getItem('access_token');

const urlConfig = {
    baseUrl: `${HOST}:${PORT}/api`,
    imageDir: `${HOST}:${PORT}/uploads/exercises`,
    assets: `${HOST}:${PORT}/assets`,
    axiosConfig: {
        headers: {
          'Content-Type': 'application/json',
          'Authorization': token,
          'Accept': 'application/json'
      }
    },
    logo_base64: 'data:image/png;base64,',
};

/**
 * Set the enviroment variables correctly
 */
let HOST;
let PORT;
// Dev
if ( hostname !== 'localhost' ) {
    
    HOST = 'http://localhost';
    PORT = '8000';
    urlConfig.baseUrl = `${HOST}:${PORT}/api`;
    urlConfig.imageDir = `${HOST}:${PORT}/uploads/exercises`;
    urlConfig.assets = `${HOST}:${PORT}/assets`;
} else { // Prod
    
    HOST = 'https://nutritioncare-api.herokuapp.com';
    urlConfig.baseUrl = `${HOST}/api`;
    urlConfig.imageDir = `${HOST}/uploads/exercises`;
    urlConfig.assets = `${HOST}/assets`;

};


export default urlConfig;